import{_ as t,c as a,o as s,ag as n}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"ALTER TYPE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_TYPE.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_TYPE.md"}'),o={name:"docs/7x/ref_guide/sql_commands/ALTER_TYPE.md"};function i(p,e,l,r,d,c){return s(),a("div",null,e[0]||(e[0]=[n(`<h1 id="alter-type" tabindex="-1">ALTER TYPE <a class="header-anchor" href="#alter-type" aria-label="Permalink to &quot;ALTER TYPE&quot;">​</a></h1><p>Changes the definition of a data type.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span></span></span>
<span class="line"><span>ALTER TYPE &lt;name&gt; &lt;action&gt; [, ... ]</span></span>
<span class="line"><span>ALTER TYPE &lt;name&gt; OWNER TO { &lt;new_owner&gt; | CURRENT_USER | SESSION_USER }</span></span>
<span class="line"><span>ALTER TYPE &lt;name&gt; RENAME ATTRIBUTE &lt;attribute_name&gt; TO &lt;new_attribute_name&gt; [ CASCADE | RESTRICT ]</span></span>
<span class="line"><span>ALTER TYPE &lt;name&gt; RENAME TO &lt;new_name&gt;</span></span>
<span class="line"><span>ALTER TYPE &lt;name&gt; SET SCHEMA &lt;new_schema&gt;</span></span>
<span class="line"><span>ALTER TYPE &lt;name&gt; ADD VALUE [ IF NOT EXISTS ] &lt;new_enum_value&gt; [ { BEFORE | AFTER } &lt;neighbor_enum_value&gt; ]</span></span>
<span class="line"><span>ALTER TYPE &lt;name&gt; RENAME VALUE &lt;existing_enum_value&gt; to &lt;new_enum_value&gt;</span></span>
<span class="line"><span>ALTER TYPE &lt;name&gt; SET DEFAULT ENCODING ( &lt;storage_directive&gt; )</span></span>
<span class="line"><span></span></span>
<span class="line"><span>where &lt;action&gt; is one of:</span></span>
<span class="line"><span>  </span></span>
<span class="line"><span>  ADD ATTRIBUTE &lt;attribute_name&gt; &lt;data_type&gt; [ COLLATE &lt;collation&gt; ] [ CASCADE | RESTRICT ]</span></span>
<span class="line"><span>  DROP ATTRIBUTE [ IF EXISTS ] &lt;attribute_name&gt; [ CASCADE | RESTRICT ]</span></span>
<span class="line"><span>  ALTER ATTRIBUTE &lt;attribute_name&gt; [ SET DATA ] TYPE &lt;data_type&gt; [ COLLATE &lt;collation&gt; ] [ CASCADE | RESTRICT ]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>where &lt;storage_directive&gt; is:</span></span>
<span class="line"><span></span></span>
<span class="line"><span>   COMPRESSTYPE={ZLIB | ZSTD | RLE_TYPE | NONE}</span></span>
<span class="line"><span>   COMPRESSLEVEL={0-19}</span></span>
<span class="line"><span>   BLOCKSIZE={8192-2097152}</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER TYPE</code> changes the definition of an existing type. There are several subforms:</p><p><strong><code>ADD ATTRIBUTE</code></strong> : Adds a new attribute to a composite type, using the same syntax as <a href="./CREATE_TYPE.html">CREATE TYPE</a>.</p><p><strong><code>DROP ATTRIBUTE [ IF EXISTS ]</code></strong> : Drops an attribute from a composite type. If <code>IF EXISTS</code> is specified and the attribute does not exist, no error is thrown. In this case WarehousePG issues a notice instead.</p><p><strong><code>SET DATA TYPE</code></strong> : Changes the type of an attribute of a composite type.</p><p><strong><code>OWNER</code></strong> : Changes the owner of the type.</p><p><strong><code>RENAME</code></strong> : Changes the name of the type or the name of an individual attribute of a composite type.</p><p><strong><code>SET SCHEMA</code></strong> : Moves the type into another schema.</p><p><strong><code>ADD VALUE [ IF NOT EXISTS ] [ BEFORE | AFTER ]</code></strong> : Adds a new value to an enum type. The new value&#39;s place in the enum&#39;s ordering can be specified as being <code>BEFORE</code> or <code>AFTER</code> one of the existing values. Otherwise, the new item is added at the end of the list of values.</p><p>: If <code>IF NOT EXISTS</code> is specified, it is not an error if the type already contains the new value; WarehousePG issues a notice but takes no other action. Otherwise, an error will occur if the new value is already present.</p><p><strong><code>RENAME VALUE</code></strong> : Renames a value of an enum type. The value&#39;s place in the enum&#39;s ordering is not affected. An error will occur if the specified value is not present or the new name is already present.</p><p>The <code>ADD ATTRIBUTE</code>, <code>DROP ATTRIBUTE</code>, and <code>ALTER ATTRIBUTE</code> actions can be combined into a list of multiple alterations to apply in parallel. For example, it is possible to add several attributes and/or alter the type of several attributes in a single command.</p><p>You can change the name, the owner, and the schema of a type. You can also add or update storage options for a scalar type.</p><blockquote><p><strong>Note</strong> WarehousePG does not support adding storage options for row or composite types.</p></blockquote><p>You must own the type to use <code>ALTER TYPE</code>. To change the schema of a type, you must also have <code>CREATE</code> privilege on the new schema. To alter the owner, you must also be a direct or indirect member of the new owning role, and that role must have <code>CREATE</code> privilege on the type&#39;s schema. (These restrictions enforce that altering the owner does not do anything that could be done by dropping and recreating the type. However, a superuser can alter ownership of any type.) To add an attribute or alter an attribute type, you must also have <code>USAGE</code> privilege on the data type.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name (optionally schema-qualified) of an existing type to alter.</p><p>new_name : The new name for the type.</p><p>new_owner : The user name of the new owner of the type.</p><p>new_schema : The new schema for the type.</p><p>attribute_name : The name of the attribute to add, alter, or drop.</p><p>new_attribute_name : The new name of the attribute to be renamed.</p><p>data_type : The data type of the attribute to add, or the new type of the attribute to alter.</p><p>new_enum_value : The new value to be added to an enum type&#39;s list of values. Like all enum literals, it must be quoted.</p><p>neighbor_enum_value : The existing enum value that the new value should be added immediately before or after in the enum type&#39;s sort ordering. Like all enum literals, it must be quoted.</p><p>existing_enum_value : The existing enum value that should be renamed. Like all enum literals, it must be quoted.</p><p>CASCADE : Automatically propagate the operation to typed tables of the type being altered, and their descendants.</p><p>RESTRICT : Refuse the operation if the type being altered is the type of a typed table. This is the default.</p><p>storage_directive : Identifies default storage options for the type when specified in a table column definition. Options include <code>COMPRESSTYPE</code>, <code>COMPRESSLEVEL</code>, and <code>BLOCKSIZE</code>.</p><p>: <strong>COMPRESSTYPE</strong> — Set to <code>ZLIB</code> (the default), <code>ZSTD</code> or <code>RLE_TYPE</code> to specify the type of compression used.</p><p>: <strong>COMPRESSLEVEL</strong> — For Zstd compression, set to an integer value from 1 (fastest compression) to 19 (highest compression ratio). For zlib compression, the valid range is from 1 to 9. For <code>RLE_TYPE</code>, the compression level can be set to an integer value from 1 (fastest compression) to 6 (highest compression ratio). The default compression level is 1.</p><p>: <strong>BLOCKSIZE</strong> — Set to the size, in bytes, for each block in the column. The <code>BLOCKSIZE</code> must be between 8192 and 2097152 bytes, and be a multiple of 8192. The default block size is 32768.</p><pre><code>&gt; **Note** storage\\_directives defined at the table- or column-level override the default storage options defined for a type.
</code></pre><h2 id="notes" tabindex="-1"><a id="section4n"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section4n&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>If <code>ALTER TYPE ... ADD VALUE</code> (the form that adds a new value to an enum type) is executed inside a transaction block, the new value cannot be used until after the transaction has been committed.</p><p>Comparisons involving an added enum value will sometimes be slower than comparisons involving only original members of the enum type. This will usually only occur if <code>BEFORE</code> or <code>AFTER</code> is used to set the new value&#39;s sort position somewhere other than at the end of the list. However, sometimes it will happen even though the new value is added at the end (this occurs if the OID counter &quot;wrapped around&quot; since the original creation of the enum type). The slowdown is usually insignificant; but if it matters, optimal performance can be regained by dropping and recreating the enum type, or by dumping and reloading the database.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To rename the data type named <code>electronic_mail</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TYPE electronic_mail RENAME TO email;</span></span></code></pre></div><p>To change the owner of the user-defined type <code>email</code> to <code>joe</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TYPE email OWNER TO joe;</span></span></code></pre></div><p>To change the schema of the user-defined type <code>email</code> to <code>customers</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TYPE email SET SCHEMA customers;</span></span></code></pre></div><p>To set or alter the compression type and compression level of the user-defined type named <code>int33</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TYPE int33 SET DEFAULT ENCODING (compresstype=zlib, compresslevel=7);</span></span></code></pre></div><p>To add a new attribute to a type:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TYPE compfoo ADD ATTRIBUTE f3 int;</span></span></code></pre></div><p>To add a new value to an enum type in a particular sort position:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TYPE colors ADD VALUE &#39;orange&#39; AFTER &#39;red&#39;;</span></span></code></pre></div><p>To rename an enum value:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TYPE colors RENAME VALUE &#39;purple&#39; TO &#39;mauve&#39;;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The variants to add and drop attributes are part of the SQL standard; the other variants are WarehousePG extensions.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./CREATE_TYPE.html">CREATE TYPE</a>, <a href="./DROP_TYPE.html">DROP TYPE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,60)]))}const m=t(o,[["render",i]]);export{u as __pageData,m as default};
